import React from 'react';
import './asoProductBox.css';

const asoProductBox = (props) => {
    return ( 
        <div className="asoProductBox">
            <img src={props.imageAdrs} style={{width: 150, height: 150}} alt="product" />
        </div>
     );
}

export default asoProductBox;
